import React from 'react';
import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { BlueDraft } from './Pages/BlueDraft';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/blueside' index element={<BlueDraft/>}/>
      </Routes>  
    </BrowserRouter>
  );
}

export default App;
